										'icon' => '/esoui/art/icons/assistant_sereyne.dds',
										'desc' => 'An outlaw with a talent for magic but a thirst for alcohol, Sereyne wants a cozy place to drink her troubles away. Perhaps you can provide? After adding Sereyne to your home, you can set her on a path, plus you and your visitors can speak with her.',
